INSERT `products` (`id`, `createdate`, `image`, `name`, `price`, `categoryid`, `number`, `available`, `describe`) VALUES (30, CAST('2022-12-30' AS Date), 'bia1.jpg', 'Bia Laru - Vui cùng miền trung nào', 251.25, 'B', 150, 1, '💁♂- Bia Larue là sự hoà quyện tinh tế mang đậm hương vị đặc trưng của hơn 100 năm truyền thống bia Pháp. 

- Sản phẩm được sản xuất với thành phần tự nhiên, trên dây chuyền công nghệ hiện đại và lên men theo công nghệ truyền thống dài ngày, tạo nên một hương vị n;n và độc đáo khác hẳn với các sản phẩm bia khác trên thị trường. Bia Larue có màu vàng sậm bắt mắt, mùi thơm đặc trưng, hương vị đậm đà, mang lại những trải nghiệm thú vị cho người thưởng thức. 😬😬😬😬😬😬😬😬😬😬

- Sản phẩm với thiết kế kiểu dáng lon nhỏ gọn, vừa tay cầm, tiện lợi khi dùng và dễ dàng bảo quản. Bia Larue thùng 24 lon x 330ml có thể dùng trong những dịp họp mặt bạn bè, cuộc gặp với đối tác kinh doanh hay đơn giản là người bạn thân thiết trong mỗi bữa ăn gia đình. Sản phẩm mang đến không khí vui vẻ trọn vẹn trong mọi cuộc vui.');
INSERT `products` (`id`, `createdate`, `image`, `name`, `price`, `categoryid`, `number`, `available`, `describe`) VALUES (31, CAST('2022-08-19' AS Date), 'bia2.jpg', 'Bia Oranjeboom Premium Strong', 352.12, 'B', 0, 0, '🚌🚌🚌🚌 Mại dô mại dô nào 🏍🏍🏍🏍
Thuộc dòng bia lager đầy sảng khoái, đem đến trải nghiệm khá tuyệt vời cho người uống. Mùi vị của những lon bia Oranjeboom này được đánh giá là điểm nhấn đầy hấp dẫn và thú vị với người dùng.
Bia hấp dẫn, với vị bia thanh mát được làm chủ yếu từ lúa mạch – hoa bia – malt cháy và nước tinh khiết. Vị bia thơm n;n, đầy thu hút và ấn tượng, đem đến điểm nhấn lôi cuốn người dùng.
Và đặc biệt hơn, với độ cồn 16% sẽ chinh phục những quý ông yêu thích khám phá các loại bia nặng độ. Oranjeboom khá thú vị, mang đến trải nghiệm tuyệt vời hơn hẳn.
🤨🤨🤨🤗🤗🤗🤓🤓🤓🤓🤓🤓🍎🍏🍐🍊🥝🌰🍳

');
