-- this is trigger to update number product
DELIMITER //

CREATE TRIGGER trg_Update_Number_Product 
AFTER INSERT ON orderdetails 
FOR EACH ROW
BEGIN
    UPDATE products 
    SET number = number - NEW.quantity 
    WHERE id = NEW.productid;
END;
//

DELIMITER ;